import React, { useEffect, useState } from "react";

export default function Dashboard({ token }) {
  const [jobs, setJobs] = useState([]);

  useEffect(() => {
    if (!token) return;

    fetch("http://localhost:8000/api/jobs/jobright", {
      headers: { Authorization: `Bearer ${token}` },
    })
      .then(res => res.json())
      .then(data => setJobs(data.jobs || []))
      .catch(err => console.error("Error fetching jobs:", err));
  }, [token]);

  return (
    <div style={{ padding: 20 }}>
      <h2>Latest Jobs</h2>
      {jobs.length === 0 ? (
        <p>No jobs found.</p>
      ) : (
        <table style={{ width: "100%", borderCollapse: "collapse" }}>
          <thead>
            <tr>
              <th>Role</th>
              <th>Company</th>
              <th>Location</th>
              <th>Published</th>
              <th>Apply</th>
            </tr>
          </thead>
          <tbody>
            {jobs.map((j, i) => (
              <tr key={i}>
                <td>{j.title}</td>
                <td>{j.company || "—"}</td>
                <td>{j.location}</td>
                <td>{j.published}</td>
                <td>
                  <a href={j.url} target="_blank" rel="noreferrer">Apply</a>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}
